import React from "react";
import {
  Modal,
  Form,
  Typography,
  Input,
  InputNumber,
  Row,
  Col,
  Select
} from "antd";

const { Option } = Select;
const PersonModal = ({ visible, data, onCancel, onhandleUpdate }) => {
  const [form] = Form.useForm();
  return (
    <Modal
      closable={false}
      visible={visible}
      onCancel={onCancel}
      onOk={() => {
        form
          .validateFields()
          .then(values => {
            form.resetFields();
            onhandleUpdate(values);
          })
          .catch(info => {
            console.log("Validate Failed:", info);
          });
      }}
    >
      <PersonModalForm form={form} data={data} />
    </Modal>
  );
};

export default PersonModal;
